import React from "react";
import { Container } from "react-bootstrap";
import logo from "../../assets/logo/logo.png";

const Header = () => {
    return (
        <div className="header">
            <Container>
                <img src={logo} alt="" />
                <ul>
                    <li>
                        <a href="">TRANG CHỦ</a>
                    </li>
                    <li>
                        <a href="">VỀ CHÚNG TÔI</a>
                    </li>
                    <li>
                        <a href="">VỀ CHÚNG TÔI</a>
                    </li>
                    <li>
                        <a href="">LIÊN HỆ</a>
                    </li>
                    <li>
                        <a href="">NHƯỢNG QUYỀN</a>
                    </li>
                </ul>
            </Container>
        </div>
    );
};

export default Header;
